import math
import collections


class Solution:
    def waysToSplit(self, nums):
        # 1 calculate sum[nums[l..r]]   0<=l<r<=n-1,
        n = len(nums)

        s = nums[::] # deep copy
        for i in range(1, n):
            s[i] += s[i - 1]

        MOD = 10 ** 9 + 7
        def summod(y, x):
            y = (y + x % MOD) % MOD
            return y

        # 2 split into 3 parts
        cnt = 0
        min_r = 1
        max_r = 1
        for l in range(1, n - 1):
            a = s[l - 1] # a 表示第一个子数组之和
            if a > (s[n - 1] // 3 + 1): # 第一个子数组之和小于数组之和的三分之一
                break

            # 2.2 二分法查找中间数组的最小右边界
            ll = max(l, min_r) # 最小右边界从l开始，并且相比上次循环中的最小右边界单调不减（因为随着l增大，最小右边界单调不减）
            rr = n - 1
            while ll < rr:
                m = ll + (rr - ll) // 2
                b = s[m] - s[l-1]
                if (b >= a):
                    rr = m
                else:
                    ll = m + 1
            min_r = ll

            # 2.3 顺序查找中间数组的最大右边界。注意：退出循环有两个条件：
            #   1. 符合循环中的if条件
            #   2. 循环变量达到最大值退出循环
            # 循环后要判断是因为哪个情况退出循环，如果是因为第二个条件，则本次查找作废，不计入cnt
            max_r = max(max_r, min_r) # 最大右边界随着l增大 单调不减
            for ll in range(max_r, n-1):
                b = s[ll]-s[l-1]
                c = s[n-1]-s[ll]
                if (b<=c):
                    max_r = ll
                else:
                    break

            if (s[max_r]-s[l-1] <= s[n-1]-s[max_r]):
                cnt = summod(cnt, max_r - min_r + 1)

            print(cnt, l, min_r, max_r)
            print("L M_min | M_max R")
            print(s[l-1], s[min_r]-s[l-1], " | ", s[max_r]-s[l-1], s[n-1]-s[max_r])
            print()

        return cnt


